(1187, NULL, NULL, 'The Richest Man In Babylon', '1939438331', 112.00, NULL, 1, 'George S. Clason', NULL, NULL, 'Dili: IŇLIS\r\nBeloved by millions, this timeless classic holds the key to all you desire and everything you wish to accomplish. This is the book that reveals the secret to personal wealth.\r\nThe Success Secrets of the Ancients—\r\nAn Assured Road to Happiness and Prosperity\r\nCountless readers have been helped by the famous “Babylonian parables,” hailed as the greatest of all inspirational works on the subject of thrift, financial planning, and personal wealth. In language as simple as that found in the Bible, these fascinating and informative stories set you on a sure path to prosperity and its accompanying joys. Acclaimed as a modern-day classic, this celebrated bestseller offers an understanding of—and a solution to—your personal financial problems that will guide you through a lifetime. This is the book that holds the secrets to keeping your money—and making more.\r\nThe Richest Man in Babylon', 1, 0, 1, '2021-05-06 19:02:01', '2021-05-06 19:11:53', '{\"0\":\"3t2bBjHtS98N6JwKKpVh6w3maRWcyr4hPZY6ys29iCziLIDznl2TjRTHfnAs7nYuGmOPELqi0vpnRx5p0jqAYFes791gEt7i24Ka.JPG\",\"1\":\"KhhWkZJU5d4ZDZ5ZU0AsyxfpgfFHPmhIQTcIXxi5k0qwbTQI58R7TvWHlv7A3tGlYPp8utua79wqdSjBr2d21Xa1x3efP5GgWsEI.JPG\",\"main\":\"vH6a7klSzVtlriANIQ9nXkgiOni2QPqmnwQiFcS41EFfPtcNXkSpjni2wEaATqBkQrUApAxyUO3Yq7zv98jMmRt83hCAyji7RzHC.JPG\"}'),
(1188, NULL, NULL, 'The 7 Habits of Highly effective people', '1451639612', 167.00, NULL, 1, 'Stephen R. Covey', NULL, NULL, 'Dili: IŇLIS\r\nWhen Stephen Covey first released The Seven Habits of Highly Effective People, the book became an instant rage because people suddenly got up and took notice that their lives were headed off in the wrong direction; and more than that, they realized that there were so many simple things they could do in order to navigate their life correctly. This book was wonderful education for people, education in how to live life effectively and get closer to the ideal of being a ‘success’ in life.\r\nBut not everyone understands Stephen Covey’s model fully well, or maybe there are some people who haven’t read it yet. This is definitely true because we still see so much failure all around us. Now, I am not saying that by using Covey’s model, or anyone else’s model for that matter, you can become a sure-shot success, but at least we should have seen many more successes around us already judging by the number of copies the book has sold! So, where is the shortcoming?\r\nThere are two main problems here, and we are talking only about the people who have read the book already. The first problem is that most people are too lazy to implement the ideals of Stephen Covey in their lives. They consider his masterpiece of a book as a mere coffee-table book or a book that you use for light reading when you are traveling and then forget all about it. They do not realize that this book contains life-changing information. Or, they take the information and do not make the effort to actually utilize it so that it becomes knowledge for them.\r\nThe second problem is that a lot of people have a myopic view of Covey’s ideals. These are people who are impressed by the book already. If you ask them what the seven habits are, they can rattle them off end to end, but then they miss the larger picture. They do not understand that Covey was trying to tell more than he wrote in words. There are hidden implications in this book, yes, and a lot of people have just failed to see through them.\r\nThat is what we are trying to do. We are trying to show you how Covey’s book, or rather, his model, was a complete model in itself. There was nothing amiss about it. If you implement it, there should be no aspect of your life that should go untouched. The only thing is that you have to understand these ideals and try to implement them in your life.\r\nBut, before we barge into that area, it is extremely important to understand what these ideals are. What was the model that was propounded by Stephen Covey in his mega-famous book? We shall begin by trying to understand his model first, and then interpret it in such a way that it pertains to every aspect of our life', 1, 0, 1, '2021-05-06 19:11:04', '2021-05-06 19:11:04', '{\"main\":\"3VPWlPXoYWu0Odhscj351vJcFPq1reeQiAnLvbN9bNjIShEnStpxZXrfiJGloZLpxhydRkG0r2wzadDeiPelJrX46wUyfll7FO53.jpg\",\"0\":\"PQ3MQ8ufVI9wKbAYctMqkdK5tZelvvpSV7UXcp7i2LEpSGMfGNDgPzw7PJTPxsx05ah3XhGF1jv775MXxYVpe865VHNLshlEpIET.JPG\"}'),
(1189, NULL, NULL, 'Atomic Habits', '0735211292', 167.00, NULL, 1, 'James Clear', NULL, NULL, 'Dili: Iňlis\r\nNo matter your goals, Atomic Habits offers a proven framework for improving--every day. James Clear, one of the world\'s leading experts on habit formation, reveals practical strategies that will teach you exactly how to form good habits, break bad ones, and master the tiny behaviors that lead to remarkable results.\r\nIf you\'re having trouble changing your habits, the problem isn\'t you. The problem is your system. Bad habits repeat themselves again and again not because you don\'t want to change, but because you have the wrong system for change. You do not rise to the level of your goals. You fall to the level of your systems. Here, you\'ll get a proven system that can take you to new heights.\r\nClear is known for his ability to distill complex topics into simple behaviors that can be easily applied to daily life and work. Here, he draws on the most proven ideas from biology, psychology, and neuroscience to create an easy-to-understand guide for making good habits inevitable and bad habits impossible. Along the way, readers will be inspired and entertained with true stories from Olympic gold medalists, award-winning artists, business leaders, life-saving physicians, and star comedians who have used the science of small habits to master their craft and vault to the top of their field.\r\nLearn how to:\r\n*  make time for new habits (even when life gets crazy);\r\n*  overcome a lack of motivation and willpower;\r\n*  design your environment to make success easier;\r\n*  get back on track when you fall off course;\r\n...and much more.\r\nAtomic Habits will reshape the way you think about progress and success, and give you the tools and strategies you need to transform your habits--whether you are a team looking to win a championship, an organization hoping to redefine an industry, or simply an individual who wishes to quit smoking, lose weight, reduce stress, or achieve any other goal.', 1, 0, 1, '2021-05-06 19:26:32', '2021-05-06 19:26:32', '{\"main\":\"yKajubEcEu2YjNNyqYzmC5lX0kE8o4ZjnGwSy3BgGOIS5IjJ5QIwmVzNX96mhnRo2QHabCLSlmDAODuXzIIQWANDMduD3u49XVFx.jpg\",\"0\":\"8sGon6Alpsj8gGERq71OKBQ7rPqG3LFxcH9jjwrq7gKb0iGnGllygxQnMTthL6pBbbVJ74L7OduszOzssdq0u2v5TnSWwfjsV6jw.JPG\",\"1\":\"ZfGTPU1zNrwrRLqYiQmVoPMpP19H1tMWOW0j4gZBCqviJ4oAb5LChilWWFVxYBQe0pxat4K9zt0STPhv4wS05Mzh7egnwgYvn0KO.JPG\"}'),
(1190, NULL, NULL, 'Becoming', '1524763138', 167.00, NULL, 1, 'Michelle Obama', NULL, NULL, 'Dili: Iňlis\r\n In a life filled with meaning and accomplishment, Michelle Obama has emerged as one of the most iconic and compelling women of our era. As First Lady of the United States of America—the first African American to serve in that role—she helped create the most welcoming and inclusive White House in history, while also establishing herself as a powerful advocate for women and girls in the U.S. and around the world, dramatically changing the ways that families pursue healthier and more active lives, and standing with her husband as he led America through some of its most harrowing moments. Along the way, she showed us a few dance moves, crushed Carpool Karaoke, and raised two down-to-earth daughters under an unforgiving media glare.\r\nIn her memoir, a work of deep reflection and mesmerizing storytelling, Michelle Obama invites readers into her world, chronicling the experiences that have shaped her—from her childhood on the South Side of Chicago to her years as an executive balancing the demands of motherhood and work, to her time spent at the world’s most famous address. With unerring honesty and lively wit, she describes her triumphs and her disappointments, both public and private, telling her full story as she has lived it—in her own words and on her own terms. Warm, wise, and revelatory, Becoming is the deeply personal reckoning of a woman of soul and substance who has steadily defied expectations—and whose story inspires us to do the same.', 1, 0, 1, '2021-05-06 19:38:47', '2021-05-06 19:38:47', '{\"main\":\"19TwDY7qls1BWbOT0YLUpOudGzH6l7m7yzVkftpU2uR7wdsDDfMG94nYu0H95n6Ri1D6AnN0sCBaBbGMxXtp5haJktjK7JVNBIVi.jpg\",\"0\":\"fjfb2jjmihr5MHQlNTKLZdVUEKRAbiVsJVhGAWyca2SzNx5m6DkXtCZxeFh4BRWbCi8kh3qcBeF2XZAZ4BpTsHiymzE0YgsXVNSq.JPG\"}'),
(1191, NULL, NULL, '21 Lessons for the 21 Century', '1787330870', 201.00, NULL, 1, 'Yuval Noah Harari', NULL, NULL, 'Dili: Iňlis.\r\n In Sapiens, he explored our past. In Homo Deus, he looked to our future. Now, one of the most innovative thinkers on the planet turns to the present to make sense of today\'s most pressing issues.\r\nHow do computers and robots change the meaning of being human? How do we deal with the epidemic of fake news? Are nations and religions still relevant? What should we teach our children?\r\nYuval Noah Harari\'s 21 Lessons for the 21st Century is a probing and visionary investigation into today\'s most urgent issues as we move into the uncharted territory of the future. As technology advances faster than our understanding of it, hacking becomes a tactic of war, and the world feels more polarized than ever, Harari addresses the challenge of navigating life in the face of constant and disorienting change and raises the important questions we need to ask ourselves in order to survive.\r\nIn twenty-one accessible chapters that are both provocative and profound, Harari builds on the ideas explored in his previous books, untangling political, technological, social, and existential issues and offering advice on how to prepare for a very different future from the world we now live in: How can we retain freedom of choice when Big Data is watching us? What will the future workforce look like, and how should we ready ourselves for it? How should we deal with the threat of terrorism? Why is liberal democracy in crisis?\r\nHarari\'s unique ability to make sense of where we have come from and where we are going has captured the imaginations of millions of readers. Here he invites us to consider values, meaning, and personal engagement in a world full of noise and uncertainty. When we are deluged with irrelevant information, clarity is power. Presenting complex contemporary challenges clearly and accessibly, 21 Lessons for the 21st Century is essential reading.', 1, 0, 1, '2021-05-06 20:10:06', '2021-05-06 20:10:06', '{\"main\":\"YQEG0XRmtnfyekzQuNtJfXm2KFIjb2s4ADHC2PXZ7asn4fu1HGXUUSv6gOat8oUpMESK9qfszNJIE58AnTMdtxwOTgzsn8sUkZEj.jpg\",\"0\":\"vHr3X3pzYQ84jP8PYxehyaMPZmlSfgeOvMzus0R8pMx1Kvtuq5Uzg7Wz5n99ebz9P9A9SWCnJeJOgQEog1xu0QsinLQ1p7nvCoDq.JPG\"}'),
(1192, NULL, NULL, 'The Making of a Manager', '0735219564', 134.00, NULL, 1, 'Julie Zhuo', NULL, NULL, 'Dili: Iňlis\r\n The Making of a Manager is a modern field guide packed everyday examples and transformative insights, including:  How to tell a great manager from an average manager (illustrations included) When you should look past an awkward interview and hire someone anyway.', 1, 0, 1, '2021-05-06 20:18:50', '2021-05-06 20:19:29', '{\"0\":\"D8wRSS17kYd8tFkSoBdahbROf8fLHQFxQUbpcXh3Y91TpJLlBLI59aKf2Wt57yRX7MTsEjVcEMdUAIlS5vqJe2Us2AmEIPHe9e5d.jpg\",\"1\":\"GlpXDamDyM1btc2Q7T1Vi4reuGbpyTeGbRmYRkKnZAGaZhw6e81Qp2Vs4vJ7iuY81DSxR5oG01Sthvki2a3Y91Dx0SgRceEG5aFt.jpg\",\"main\":\"IR5bS4jXlW9DFwRON4kZZlNHjjMJQDDq2W016jNcjZaGA497smLqU1TMzzHbecwpjKxfMYP7EdvIYvRaQ4vyg8tarwHerN5kVTDI.jpg\"}'),
(1193, NULL, NULL, 'Think Big', '1942125044', 89.00, NULL, 1, 'Ryuho Okawa', NULL, NULL, 'Dili: Iňlis\r\n This self-development book offers practical steps to consciously create a life of rewarding challenge, fulfillment, and achievement. Using his own life experiences and wisdom as the roadmap, Ryuho Okawa inspires us with practical steps for building courage, choosing a constructive perspective, finding a true calling, cultivating awareness, and harnessing our personal power to realize our dreams. Think Big! offers the support and encouragement to shift to new ways of thinking and mastering self-discipline. Okawa s self-proven approach fosters stability and strength in the challenges each of us faces. In addition to his relatable stories and a motivational voice to keep us going, each chapter builds on the next for concrete methodologies that, when added up, are a track to support your dreams, yourself, and your life. Put in place, these day-to-day life tools can help us in living courageously with no regrets, and maximizing our potential. Think Big! also offers the map that helps us confront self-doubts and move us past discouraging obstacles. This book lets us shift our perspectives on failure and vulnerability, learn to charge toward difficult situations, and move away from judgment when we make mistakes. Fast-tracking our goals takes more than just positive thinking it takes a plan, passion, action and habits that create success. Okawa s simple, relatable wisdom is outlined to cultivate knowledge-seeking, motivated beings that translate personal visions into action for greater happiness and success. Off the pages comes the courage to get unstuck, get clear and focused, and get into action. The transformation is simple; it starts with thinking big. Think Big! a self-development book that can make a big impact toward a meaningful future.\"', 1, 0, 1, '2021-05-06 21:09:31', '2021-05-06 21:09:31', '{\"main\":\"uKvvd0Hhgt8Nd85Por5jIs6vxQnv0pgjs31pTpI7zCUbXLHKNssyQu3yTelJrvpO9ys9oHkPPu2KyIF3cGfip2uNZKALJ5P116kv.jpg\",\"0\":\"lZzsgpo1P8TAuPfwJHdHU1MYfDWEatcSaBXDQ5kYCjIyJje6yavfQ4wBmPMsNLL2ExhWPHv0nV7cjcFB5szyqOsvVjugiP26jcQX.JPG\"}'),
(1194, NULL, NULL, 'DIARY of a Wimpy Kid CABIN FEVER', '0141342085', 67.00, NULL, 1, 'Jeff Kinney', NULL, NULL, 'Çagalar üçin kitap. Dili: Iňlis\r\nÇap ýyly: 2011', 1, 0, 1, '2021-05-06 21:24:20', '2021-05-06 21:24:20', '{\"main\":\"Rf3GQ6glIhsGKDdftCapIvg4zz0uuvLPdjO1GTXSdJdjKySz0ykizgeF0uKdTKebRu1NhT4ariaVVKSnEWckCWGi066Rw3VWWNZW.jpg\",\"0\":\"jyqwQPFoA9PbGPOcnyPIISqClsR9eHm9Sci6k7pdeQLhqLEg66YKDkGEJYRBBz50DIswtpkEYvn9rqTneCUqXvGvrO4CFFoC2W59.JPG\"}'),
