(1196, NULL, NULL, 'DIARY of a Wimpy Kid THE UGLY TRUTH', '0141340821', 67.00, NULL, 1, 'Jeff Kinney', NULL, NULL, 'Çagalar üçin kitap. Dili: Iňlis. Greg Heffley has always been in a hurry to grow up. But is getting older really all it’s cracked up to be?\r\nGreg suddenly finds himself dealing with the pressures of boy-girl parties, increased responsibilities, and even the awkward changes that come with getting older—all without his best friend, Rowley, at his side. Can Greg make it through on his own? Or will he have to face the “ugly truth”?', 1, 0, 1, '2021-05-06 21:57:07', '2021-05-06 21:57:07', '{\"main\":\"Gcs5C8HYLuEsSlLsO5PW5Y40sTgoi5PcUZpqqJY3QgisR33ryalt1vkuRINOMcQPQ9r4f9688PT0elHqIZxvz9KCeqwIqT9MK13R.jpg\",\"0\":\"iahaRoInMJ23Lgpjhin0AWLnVuWkjzLlI2WQxEPcZGfjp3aRboMM8cpxAU5IULUKlK9MwxN6vPiQj2inTYjBBXYbUoUhrTpaGD8V.JPG\",\"1\":\"5u71PUn78N132BeTtVKsgAUTmE1WOzoNK9VnGPRgJsOWkUMbaetRJ1jgbAwpvZmDdnQkfjkYFL0ZCsZ5F7dvEJrCdY04Hl5Y31cI.JPG\"}'),
(1197, NULL, NULL, 'DIARY of a Wimpy Kid THE LAST STRAW', '0810988217', 67.00, NULL, 1, 'Jeff Kinney', NULL, NULL, 'Dil: Iňlis.\r\nÇap ýyly: 2009.\r\nLet’s face it: Greg Heffley will never change his wimpy ways. Somebody just needs to explain that to Greg’s father. You see, Frank Heffley actually thinks he can get his son to toughen up, and he enlists Greg in organized sports and other \"manly” endeavors. Of course, Greg is easily able to sidestep his father’s efforts to change him. But when Greg’s dad threatens to send him to military academy, Greg realizes he has to shape up . . . or get shipped out.', 1, 0, 1, '2021-05-06 22:09:41', '2021-05-06 22:09:41', '{\"main\":\"lnhI2uOtZFIhrifwbTYpziGborykmfdqzu7xUJbkFnJkDGkcO1BX9Mtbw1I9elq3BqSvml17oqqC38xihmz2dw7O0DOSgasAWTKy.jpg\",\"0\":\"dObb9D2GKCPdAOqiee7i7L8REvKtRUrg3Xuqi3S5kQpJsYGAMTousmVJjFgknJN5S3fkOZWqo8Y60oCaOlg5lMxzvL0YZYRiqd5D.JPG\"}'),
