(1199, NULL, NULL, 'DIARY of a Wimpy Kid THE MELTDOWN', '1419727436', 67.00, NULL, 1, 'Jeff Kinney', NULL, NULL, 'Dili: Iňlis.\r\nÇagalar üçin kitap\r\nWhen snow shuts down Greg Heffley’s middle school, his neighborhood transforms into a wintry battlefield. Rival groups fight over territory, build massive snow forts, and stage epic snowball fights. And in the crosshairs are Greg and his trusty best friend, Rowley Jefferson.\r\nIt’s a fight for survival as Greg and Rowley navigate alliances, betrayals, and warring gangs in a neighborhood meltdown. When the snow clears, will Greg and Rowley emerge as heroes? Or will they even survive to see another day?', 1, 0, 1, '2021-05-07 14:43:43', '2021-05-07 14:45:38', '{\"0\":\"d21Wn61KKWgPrAG56YGhJdyNSSzLx5Mx8QFfqgODFfe2VTU3hFbVH5bPhQ1cD2NfGXPO4yQZhlno7NnH8qlg8ctaEY3z33fFiWVL.jpg\",\"main\":\"JpIuTuC0gSjNXD5kUocssjrq7W5xqVktkBQdpwxkbFD2Jtn930UI2dO1SKsm9QTkMGHsW37rHHRVkHN70Hmxh9pz8NOvwhK0ZAZT.jpg\"}'),
