(1516, NULL, NULL, 'The Rules of Parenting', '1292088044', 78.00, NULL, 1, 'Richard Templar', NULL, NULL, 'Dil: Iňlis.\r\nThere are lots of wrong ways to bring up your kids, but there are lots of right ones, too. There\'s no list of instructions you have to follow to the letter if you don\'t want your child to end up a loser. This book presents the principles to follow which you can adapt to suit you and your children. Beginning with the first rule Relax and continuing through 100 rules, this book presents a guide to everything a parent needs to know from toddling, school, boyfriends or girlfriends, through driving lessons and college. The book begins with a section that covers the most important rules, The Rules for Staying Sane. The rest of the sections cover the some of the big questions of parenting, including the Attitude Rules, the Discipline Rules, the Sibling Rules, the School Rules, the Teenage Rules, the Crisis Rules, all the way up to the Grown-up Rules.', 1, 0, 1, '2021-06-07 16:02:20', '2021-06-07 16:02:20', '{\"main\":\"gxYjK0lLNWcBppgkxs3ZJ5G0FS2jdhtyYGUVauqXNKG6vFGTxwTzZ84ekvESHvKMampO2y9N8CYZCij0vNbfMe9Aam6aazzdmsDD.jpg\",\"0\":\"9aaiP4rbduQErs8kCj9sBrarVxpIekA5CcH1I2RfMG8rVxhuQvgv5lt2tFVieZxSUX1V0lSj82VnrHylGopXIhJjxixBtlLJaBuW.jpg\"}'),
(1518, NULL, NULL, 'The Rules of Love', '1447929505', 78.00, NULL, 1, 'Richard Templar', NULL, NULL, 'Dil: Iňlis. \"Love\".\" \" Some people know how to find it...Share it...Make it last. Were they born that way? No. They\'ve learned the rules. Rules you can learn, too. \"The Rules of Love.\" Here they are: 100 simple rules to live and love by... Rules for finding a partner you can love for a lifetime... and keeping your partner just as happy...for keeping your relationship fresh, intimate, and wonderfully surprising...for getting past game playing, jealousy, arguments, and history...for actually, really communicating...for knowing what matters, and what doesn\'t... for building better relationships with your entire family (including your kids...maybe even your in-laws) The most important rules you will ever follow Follow them to joy, to contentment, to lifelong love.', 1, 0, 1, '2021-06-07 16:10:36', '2021-07-01 19:24:47', '{\"0\":\"8MmwC0wtCa3vJGmk4D9KzNYDq225oLHtQVx4X4vvYAavzVSAgh25t4vQanNBpJXBuD9Adyv1n8BWoywiB2rZutMmcYyFF32r2wQZ.JPG\",\"main\":\"BKV2iVvekiREDNb7ovgpoEXWgx1RMhlTSHrCWOAKc7GmTjxhbmWh5GZjqE4gguT6E8WKkytbhs3nr5kBGYU8niK0Pt17hsf52a0z.JPG\"}'),
(1519, NULL, NULL, 'The Rules of Work', '1292088082', 78.00, NULL, 1, 'Richard Templar', NULL, NULL, 'Dil: Iňlis.\r\n For some people, work\'s a breeze: they glide effortlessly through all the office politics and back stabbing, always saying and doing the right thing, getting raises, getting promotions, getting results. What do they know that everyone else doesn\'t? The rules of work. Those rules are surprisingly easy to learn -- and once you know them, they\'re equally easy to live by. Now, Richard Templar\'s brought them all together in one place: the quick, irreverent The Rules of Work: A Definitive Guide to Personal Success. Templar doesn\'t just show you how to LOOK more effective: he shows you how to BE more effective in today\'s workplace environments. Discover how to get ahead without compromising your principles; how to project the air of confidence and energy that wins respect; how to carve out a powerful niche for yourself; how to handle conflict without alienating the warriors; how to read your corporate culture; when to speak and when to remain silent; when to stay late and when to leave early; and how to capitalize on the key moments that can supercharge your career.', 1, 0, 1, '2021-06-07 16:15:07', '2021-06-07 16:15:07', '{\"main\":\"5NA3b7KYBylSpj6TNbtXJYx2BmJwQ7ZN2SPKfa2p71uD8RWmZLQbBtlFDmtYbght79YNIhVt9j4OoaYIkcJIEN2l1cypBXs4ywEi.jpg\",\"0\":\"aEL85PuLeyj1vPvmcbzPgPjTEqvfd0AatNi4uspaAz0lnfBf5WghoFLPdLy2EGyL2Q1JLR6eH2EWK3Gnl89N5a7fam02uWPR8wPr.jpg\"}'),
(1520, NULL, NULL, 'The Last Letter From Your Lover', '0340961643', 151.00, NULL, 1, 'Jojo Moyes', NULL, NULL, 'Dil: Iňlis.\r\nIt is 1960. When Jennifer Stirling wakes up in the hospital, she can remember nothing-not the tragic car accident that put her there, not her husband, not even who she is. She feels like a stranger in her own life until she stumbles upon an impassioned letter, signed simply \"B\", asking her to leave her husband.\r\nYears later, in 2003, a journalist named Ellie discovers the same enigmatic letter in a forgotten file in her newspaper\'s archives. She becomes obsessed by the story and hopeful that it can resurrect her faltering career. Perhaps if these lovers had a happy ending she will find one to her own complicated love life, too. Ellie\'s search will rewrite history and help her see the truth about her own modern romance.\r\nA spellbinding, intoxicating love story with a knockout ending, The Last Letter from Your Lover will appeal to the readers who have made One Day and The Guernsey Literary and Potato Peel Pie Society bestsellers.', 1, 0, 1, '2021-06-07 16:33:08', '2021-06-07 16:33:08', '{\"main\":\"xEH3gpFOBrosA1zecVAjyJ7nMrupYoG1xVVUQVl5Ht4Z2jkQnEMr7xFG9UYFt4U2uCRDrm27Bt8bp5qLyk7kZe49GRm6eA09ghPV.jpg\",\"0\":\"I1iqzHNs2qPf9v4v45bK2uYFFmIujMtHRE7RfqEuBHM4xaaAFCInS3aLz1HVrvXWj84lDwVQFkNxSWWLOqDzV8BBR6FyKmggQOLB.jpg\"}'),
(1521, NULL, NULL, 'Sheltering Rain', '0340960356', 151.00, NULL, 1, 'Jojo Moyes', NULL, NULL, 'Dil: Iňlis.\r\n From the #1 New York Times bestselling author of Me Before You, the basis for the major motion picture, comes the touching, unforgettable story of three generations of Irish women faced with the fundamental truths of love, duty, and the unbreakable bond that unites mothers and daughters.\r\nEstranged from her mother since she ran away from her rural Irish home as a young woman, Kate swore a future oath that she’d always be a friend to her daughter, Sabine. But history has a way of repeating itself, and Kate now faces an ever-widening chasm between herself and her daughter. With Sabine about to make her own journey to Ireland to see the grandmother Kate abandoned, Kate is left wondering how they ever made it here, and what she can do to close the gap between them. \r\nFor Joy, seeing her granddaughter is a dream come true. After the painful separation from Kate, she’s looking forward to having time with Sabine. Yet almost as soon as the young woman arrives, the lack of common ground between them deflates her enthusiasm. And when Sabine’s impetuous, inquisitive nature forces Joy to face long-buried secrets from her past, she realizes that perhaps it’s time to finally heal old wounds.', 1, 0, 1, '2021-06-07 16:48:53', '2021-06-07 16:48:53', '{\"main\":\"znnUiPr75iE5Y9Dzp42qp5DVxmhcwYQxtffzmkmQP6nEzCHSeXvxaVwulfx9ALvQT0Je0rfTbMofYgCC7OsQVehosJf8BLPACbKX.jpg\",\"0\":\"EDaq96DvqfRQBSEPcoDK8Rg2RsQFUsIT5ZvLxjcZobENfpsgW4aO3vehJrfJDb4wwWgABngDlhqF4PphqtubyqolY9gv4wWkr1vf.jpg\"}'),
(1522, NULL, NULL, 'After You', '0143108863', 112.00, NULL, 1, 'Jojo Moyes', NULL, NULL, 'Dil: Iňlis.', 1, 0, 1, '2021-06-08 14:07:50', '2021-06-08 14:07:50', '{\"main\":\"ikRzbAKMD5GdNypkqKcXUdyFTnuJdBQbUpgiQlGkan3yGSf1hU68jbc0FzjOpnxoxr6f2Z18RMFJUHjXGHmftZ2EgTPOiVFlHKeG.JPG\",\"0\":\"9dnFVln0WTKiZmEPmk003y6Ela4Vnztg8lbAF9kfMJZ86IAxXESI0QJW6TEWyw1x8HbhqUVmg3Y06euYJ7QYl0UTTM0BcHzjG76k.JPG\"}'),
(1523, NULL, NULL, 'Me Before You', '0143124542', 112.00, NULL, 1, 'Jojo Moyes', NULL, NULL, 'Dil: Iňlis.\r\nThey had nothing in common until love gave them everything to lose . . .\r\nLouisa Clark is an ordinary girl living an exceedingly ordinary life—steady boyfriend, close family—who has barely been farther afield than their tiny village. She takes a badly needed job working for ex–Master of the Universe Will Traynor, who is wheelchair bound after an accident. Will has always lived a huge life—big deals, extreme sports, worldwide travel—and now he’s pretty sure he cannot live the way he is.\r\nWill is acerbic, moody, bossy—but Lou refuses to treat him with kid gloves, and soon his happiness means more to her than she expected. When she learns that Will has shocking plans of his own, she sets out to show him that life is still worth living.\r\nA Love Story for this generation and perfect for fans of John Green’s The Fault in Our Stars, Me Before You brings to life two people who couldn’t have less in common—a heartbreakingly romantic novel that asks, What do you do when making the person you love happy also means breaking your own heart?', 1, 0, 1, '2021-06-08 14:27:23', '2021-06-08 14:27:23', '{\"main\":\"DWNvbUzdw2kWunWGWSPzqNwmg6OMV3gWWJ1MbknTGpSVrGXxurxOambiBEPmJQyb7hDHooggfjvmmeUolMWMcNJPfQhjSR2s4bRm.jpg\"}'),
(1524, NULL, NULL, 'Mr Penumbra\'s 24-hour Bookstore', '1782391210', 145.00, NULL, 1, 'Robin Sloan', NULL, NULL, 'Dil: Iňlis.\r\n The Great Recession has shuffled Clay Jannon away from life as a San Francisco web-design drone and into the aisles of Mr. Penumbra\'s 24-Hour Bookstore, but after a few days on the job, Clay discovers that the store is more curious than either its name or its gnomic owner might suggest. The customers are few, and they never seem to buy anything; instead, they \"check out\" large, obscure volumes from strange corners of the store. Suspicious, Clay engineers an analysis of the clientele\'s behavior, seeking help from his variously talented friends, but when they bring their findings to Mr. Penumbra, they discover the bookstore\'s secrets extend far beyond its walls.', 1, 0, 1, '2021-06-08 14:34:25', '2021-06-08 14:34:25', '{\"main\":\"yNbtRVo5BKPj7MqMTK0sn7YMsaKvqE7MkJ47iomGqKaAAHO6NOEQPbrTdB1y0AyPTCNOfDkXzp0zlpQvVLaOPs10sE8HcYIwh3qa.jpg\",\"0\":\"dqbwpkW4OB6eGJCLDL3iO1AzAqE0S31ufzvWQNTIkhQzxhYig6yOzVc47EBWnU9A7eCsMcdFBHz8akASqGJregwr282LjAkkmlSC.JPG\"}'),
(1525, NULL, NULL, 'And the Mountains Echoed', '1408842423', 167.00, NULL, 1, 'Khaled Hosseini', NULL, NULL, 'Dil: Iňlis.\r\nTen-year-old Abdullah would do anything for his younger sister. In a life of poverty and struggle, with no mother to care for them, Pari is the only person who brings Abdullah happiness. For her, he will trade his only pair of shoes to give her a feather for her treasured collection. When their father sets off with Pari across the desert to Kabul in search of work, Abdullah is determined not to be separated from her. Neither brother nor sister know what this fateful journey will bring them.', 1, 0, 1, '2021-06-08 14:50:37', '2021-06-08 14:50:37', '{\"main\":\"lGoJg15nztZHqo1W8ZmRflaTamJrWZfH1pvEQwdkyOUevxji5fcN2iJEd0Ha2oQKHQdEVSveJNX9rXVYU6oD0S1vpDJclWhShqFv.JPG\",\"0\":\"5nWI7uxOFGHUubSdoJVYId0teA3iaHT5OO0WPUIPqplruxxU9jchSsucAKPtgl79CbLReCaK6T66JCzkJIGhChgtBuT9RM1qNvsU.JPG\"}'),
