(1833, NULL, NULL, 'ARTISTRY SKIN NUTRITION arassalaýjy jele', '123792', 1848.10, NULL, 1, 'AMWAY', NULL, NULL, 'Esasy aýratynlyklary:\r\nDerini çuňňur arassalaýar.\r\nArtykmaç ýaglary we hapalary aýyrýar.\r\nDykylan gözenekleriň we kemçilikleriň öňüni alýar.\r\nDerini azajyk sowadýar we rahatlandyrýar. Duýgur deriler üçin niýetlenen.\r\nDerini guratmaýar.', 1, 0, 1, '2021-09-10 21:03:47', '2021-09-13 14:57:19', '{\"0\":\"2H6qN0LoBkUV3Li2w0ool0knv9TBXyolpWA2biAIpiwHlVc14MB8sCbgXGbWWyXAqq3zR2khxpyCTLUu6JBkzhSf0q0vQl4d8qww.jpg\",\"1\":\"OEuJ5N4SzFJxVW6oAXGqot5JP6tBG3gMmTY0I8g9TKOChvlxP4mDHkOWjrpPlZ9PWqgF1OdFBtOHqXMg8s9jqqC0EKBeXZtJ0STt.jpg\",\"2\":\"febCAHV5GksVv1V6uGuNYcBBI2jhV4Dli8VDcjmLZpoIoBWVGBWTd8vp9K6A4EYlO3ulax2y7z5PqToSqEDcTzoMJ7CRbGyuMKvm.jpg\",\"main\":\"04cQOukfQkvBBAeyDvAXoSjzcYVPLMHK9L9edYWXkcwLJqZ2Hwp90XWo1RKm2AgqbqNVHgWFeqmbtw3nUt34IEeuKYtSdhQLv0Xa.jpg\"}'),
