(1835, NULL, NULL, 'ARTISTRY SKIN NUTRITION ýüz üçin tonik', '123794', 1232.10, NULL, 1, 'AMWAY', NULL, NULL, 'Esasy aýratynlyklary:\r\nDeriniň ýagyny gözegçilik edýär we dera mat effekty berýär.\r\nDeriniň mikrobiomyny goldaýar.\r\nDerini sazlaýar we has ideg ädimleri üçin derini taýýarlaýar.\r\nGözenekleri ýapmaýar.\r\nDerini guratmaýar. Duýgur deriler üçin niýetlenen. Öndürilen ýurdy: ABŞ. Agramy: 200 ml.', 1, 0, 1, '2021-09-13 15:35:27', '2021-09-13 15:35:27', '{\"main\":\"eyOGf9wfAZJzLkghi1CSdOBougavhQxWOtq9ohBMUvw2LYXgROcVXFycjhJUWyIryjyM9Zs6qd0RsLE1kSmSAzSuEzMHeysnBlwD.jpg\",\"0\":\"RLMkQLx16sWGz89fPd59O35ruYFyz9BV0RmIqCQsDYhpzfKJeIG7Sq46XUBrPhPXEwgZv4x50MQNmpDUxVW576EEGnWAtBuqDxR0.jpg\",\"1\":\"BQMLrtuSR0XuEcHilgRSXcMM3vZBla5n41ovgErMtIX7xTF4TXGkWnxzDe4HMPndL27zTmKfmr8r5m0nNxbAVh8jRZMMM20KYpmK.jpg\",\"2\":\"9Xtr4rPOzmieygncGuXTfIZxaPBdOyimtIth1uEyZhqfF9MWp9oJwDmb5nm5esqTk19arhIo2QsOLd4TBV03H1VPbYeRAsBXcqzf.jpg\"}'),
