(1905, NULL, NULL, 'ARTISTRY SIGNATURE SELECT ýüz üçin nemlendiriji maska', '122343', 1980.10, NULL, 1, 'AMWAY', NULL, NULL, 'ARTISTRY SIGNATURE SELECT ýüz üçin nemlendiriji maska uçarlarda we howa şertli otaglarda hapalanmak, ýel we gaty gurak howa ýaly agressiw daşky gurşaw faktorlaryndan ejir çekýän derini köşeşdirmäge kömek edýär. Maska çuňňur işleýär we derä günüň dowamynda dessine nemliligiň, tekizligiň we çeýeligiň duýgusyny berýär. Ýumşak kremli dokumasy derini ýapýar we çuňňur we köp wagtlyk çyglylyk bilen doldurýar. Ýumşak elastik kremli gurluşly ter güýçlendiriji gök çaý reňkli. Maskada antioksidant häsiýetleri bilen tanalýan NUTRILITE  gök çaý ekstrakty bar. Nemlendiriji maska ​​suwy özüne çekýär we deriniň ýüzünde saklaýar.\r\nÝüzüňizi ýuwaş-ýuwaşdan owkalaň we maskany 7 minut goýuň. Gözleriň we dodaklaryň töwereginden daşda duruň. Ýyly suw bilen ýuwuň. Gündelik ulanmak üçin amatly. Ýokarky notalar: gök çaý, sitrus miweleriniň garyndysy. Orta notalar: gülli akordy. Aşakdaky notalar: ýyly muskus.', 1, 0, 1, '2021-09-23 16:41:21', '2021-09-23 16:41:21', '{\"main\":\"yfbPYk2dlsv53d0K33Da3grLtFT8R2I3lwLaxv74c04UQtYfFcsg6RalbC6gyEIEVMKalVl9wfRh5l4nWNuhEvF5XfyD0rgf2G0s.jpg\",\"0\":\"4A6mDjP4Z3yQtW1n27jQHqxODq6kqWEObVPwkYoOaPm0wYWSB8oM7BjPZSWNedXc6Ym7IcCDHzVoIiSfKVxaQ7fUQCg8wuoAIeoc.jpg\",\"1\":\"ly1h53lyrN1XufJv8iJEUfemeaUUnbIfAM2XIrkUsxDVvaJJKItvHalkg2Kvm4Ml2FiPvogzxtSLhBJU7raLoBmmSvgMnHtRFf2I.jpg\"}'),
(1906, NULL, NULL, 'ARTISTRY SIGNATURE SELECT  ýüz üçin berkidiji maska', '122341', 1980.10, NULL, 1, 'AMWAY', NULL, NULL, 'ARTISTRY SIGNATURE SELECT  ýüz üçin  iýmitlendiriji  maska ​​derini has berk, çekdirilen we täzelenen ýaly etýär. ownuk ýygyrtlary ýumşadýar. Deriňiz täze energiýa impulsyny alana meňzeýär we iýmit maddalary bilen doýýar. Maskanyň innowasiýa formulasy gurluşyny üýtgedýär: deride massaž edilende  ýelimli gel açyk we ýelimli gelden ýumşak kremli ak emulsiýa öwrülýär. Nar ekstrakty NUTRILITE ™ antioksidant täsir edip, öýjükleri goraýar we kollagen we elastin süýümleriniň zaýalanmagynyň öňüni alýar, lipid barýerini dikeldýär we lifting täsirini berýär. Ýyladyş tehnologiýasy derä ulanylanda ýakymly ýylylyk duýgusyny üpjün edýär. Ýüzüňizi ýuwaş-ýuwaşdan owkalaň we maskany 7 minut goýuň. Gözleriň we dodaklaryň töwereginden daşda duruň. Ýyly suw bilen ýuwuň. Gündelik ulanmak üçin amatly. Ýokarky notalar: gyzyl miweleriň garyndysy, sitrus. Orta notalar: gülli akordy. Aşakdaky notalar: açyk agaç akkorde.', 1, 0, 1, '2021-09-23 18:55:47', '2021-09-23 18:55:47', '{\"main\":\"3eSsnncUtKNiZsTdsEKzDmGIuIQy2CxwOWBAauwTywb1ATyxRscF0r61iTJI5ZhWA6q4ddHmfSA6XQurR77fnWshXvwO5fU2mIZ2.jpg\",\"0\":\"UMjJ9nwWccul1sY15EQUM7ywXjIWqIslvBl1ylvPRMHh982wlPCqJ7DfRVnKTzbAvOdohbQthkEeqvItl5PAMUtlDkmwNW14VmWF.jpg\",\"1\":\"KrXbOZFSFyLTJJCwofFhFx26AhW9ekbNoVnJ3aNWk0erDlqXLpiNvCd3wkc3iVSk9q7AtOAilrErjZQ0btmjwCBvKvJcxEmNx48E.jpg\"}'),
(1907, NULL, NULL, 'ARTISTRY SIGNATURE SELECT lifting toplumy', '123757', 4840.20, NULL, 1, 'AMWAY', NULL, NULL, '\"Lifting\" toplumy, ýaş bilen baglanyşykly üýtgeşmeleriň, şol sanda deriniň çeýeligini ýitirmek alamatlaryna garşy göreşmek üçin niýetlenendir. ARTISTRY SIGNATURE SELECT bazasy we berkidiji konsentraty öz içine alýar. \"Lifting\" toplumyny goşmaça konsentratlar: nemlendiriji konsentrat we gyrma garşy konsentratlar bilen bilelikde synap görmegiňizi maslahat berýäris. “ARTISTRY SIGNATURE SELECT ™” ulgamynyň esasyny düzýär. Nutrilite ™ ekerançylyk ösümliklerinden fitonitrientleri (acerola alça, gara smorodina, gök çaý, nar we ysmanak) we ARTISTRY tehnologiýasyny birleşdirýär. Aýratyn ulanmak üçin niýetlenmedik, konsentratlaryň täsirini üpjün edýär, derini iýmitlendirýär we aralaşmagyny 175% ýokarlandyrýar. \r\n-Deri has berk we tonly bolýar;\r\n-Ýüz keşpleri has anyk kesgitlenýär;\r\n-Maňlaý  has çekdirilýä;\r\n-Aýallaryň 92% -i deriniň çeýeliginiň gowulaşandygyny bellediler ;\r\n-Aýallaryň 80% -i has berk deri  diýip habar berdiler. \r\nGaryşyk prosesi:\r\n1) Şahsy serum çüýşesinden gapagy aýryň.\r\n2) Öz saýlan konsentratyňyzy şahsy serum çüýşesine dakyň we ol saklanýança saga ýuwaşlyk bilen öwrüliň. Soňra işjeňleşdirmek üçin konsentrat konteýnerini çepe öwüriň. Soňra konsentrat gapy aýyryň.\r\n3) B ädimiňizi öz islegiňiziň beýleki konsentratlary üçin gaýtalaň.\r\n4)  flakony gapak bilen ýapyň. Çüýşäni berk ýapmak üçin gapagy seresaplyk bilen togalaň.\r\n5) Önümi gowy garyşdyrmak üçin serişdäniň flakonyny 60 sekunt çaýkaň. Günde iki gezek, irden we agşam, arassalanan derä 2 damja çalyň we ýumşak ýokary hereketlerde ýüzüň ähli ýüzüne ýaýyň.', 1, 0, 1, '2021-09-23 19:42:24', '2021-09-23 19:42:24', '{\"main\":\"glCbqya4IKfENumU0704E7bjq6RrDjHDSgq3lTQ3dU3bcKsutSR6jzqUQkH17H7kgRzsDr7bLwj2JM0IoK4yswPOByjO5nWPmyxa.jpg\",\"0\":\"Nd9ajwZ5gMbQhwAklR4iTP1uICCqlxKQrKXzJEK7fw7q0B98ocWjYBzeu30qzPfEi269CjpwNd1iR8HRsUIbuu5XMo4nZ6DnkLpw.jpg\"}');
